import { ModuleWithProviders } from "@angular/core";
import { Routes, RouterModule } from '@angular/router'

// Import User
import { UsuarioEdicionComponent } from "./components/usuario-edicion.component";
import { ListaPedidosComponent } from "./components/lista-pedidos.component";
import { InicioComponent } from "./components/inicio.component";

const appRoutes: Routes = [
    {
        path:'',
        redirectTo: '/pedidos', // Luego cambiarlo
        pathMatch: 'full'
    },
    { path: '', component: UsuarioEdicionComponent },
    { path: 'mis-datos', component: UsuarioEdicionComponent },
    { path: 'inicio', component: InicioComponent },
    { path: 'pedidos', component: ListaPedidosComponent },
    { path: 'cuenta', component: UsuarioEdicionComponent },
    { path: 'informacion', component: UsuarioEdicionComponent },
    { path: 'enviar-sugerencia', component: UsuarioEdicionComponent },
    { path: 'cerrar-sesion', component: UsuarioEdicionComponent },
    { path: '**', component: UsuarioEdicionComponent }
];

export const appRoutingProviders: any[] = [];
export const routing: ModuleWithProviders<any> = RouterModule.forRoot(appRoutes);
